const ENDPOINT = "http://localhost:4003/db/users"

export default function GetFavs({ jwt  }) {





    return fetch(`${ENDPOINT}`, {
      method: "GET",
      headers: {
        'Content-Type':' application/json',
        "Authorization": `bearer ${jwt}`
      }})
      .then((res) => {
        if (!res.ok) //throw new Error(` cypress Response is NOT ok in get favs service ll" ${res}`);
        console.log("cypress eerror should be here", {res})
        return res.json();
      })
      .then((res) => {
        const  gifs = res;

       console.log('from get fav service',gifs )

        return gifs;
      });
  }
